import React from 'react';
import logo from './logo.svg';
import './App.css';

function Hero() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          Alex Graham IT Contractor and Website Builder
        </h1>
        <p>
          Scroll Down<br/>
          for more information
        </p>
      </header>
    </div>
  );
}

export default Hero;
